        <div class="box_wide">
        <h1>Herzlich Willkommen bei winterwork,</h1>
        <h2 class="unterschrift_blau">Ihr Partner in Sachen Werbetechnik und Digitaldruck.</h2>
        <p>Der Wandel der Medienwelt geht auch an der Druckbranche nicht vorbei. Ganzheitliche Ansätze und verschiedene Medien werden zur Kundenkommunikation genutzt. Die Ansprache der Sinne steht im Vordergrund. Ausschließlich Druckerei zu sein ist zu wenig!</p>
        <p>Vielmehr muss das Spektrum der angebotenen Leistungen weit gefächert sein, um den Ansprüchen der Kunden gerecht zu werden. Deshalb ist winterwork Ihr Partner für die individuelle Kundenkommunikation, sei es im Druck, Werbetechnik, Laserdesign, Direktmarketing oder Buchbinderei.</p>
        <p>Schauen Sie sich auf unserer Homepage um und entdecken Sie Möglichkeiten einer vielfältigen Geschäftsbeziehung mit winterwork. Überzeugen Sie sich von unseren Referenzen und interessanten Projekten die wir realisiert haben.</p>
        <p>Ihr Mike Winter</p>
    </div>


